To define the styles for the variants, you can use Tailwind CSS utility classes. Here's an example of how you can define the styles in your CSS file:

```css
.layout {
  /* Common styles for both variants */
  margin: 0 auto;
  padding: 1rem;
}

/* Full-width variant */
.layout.full-width {
  max-width: 100%;
}

/* Centered variant */
.layout.centered {
  max-width: 1200px;
}
